import { PageHeader, Button, Table, Row, Col } from 'antd';
import React from 'react';
import Layouts  from '../../components/Layout/Layouts';
import { FiUserPlus } from "react-icons/fi";

const data = [
    {
        key: '1',
        name: 'John Brown',
        age: 32,
        address: 'New York No. 1 Lake Park',
    },
    {
        key: '2',
        name: 'Joe Black',
        age: 42,
        address: 'London No. 1 Lake Park',
    },
    {
        key: '3',
        name: 'Jim Green',
        age: 32,
        address: 'Sidney No. 1 Lake Park',
    },
    {
        key: '4',
        name: 'Jim Red',
        age: 32,
        address: 'London No. 2 Lake Park',
    },
];


const Patient = () => {

    return (
        <Layouts>
            <Row>
                <Col span={22}>
                    <PageHeader
                        title='Patient'
                        extra={<Button size="large">Add Patient <FiUserPlus /></Button>}
                    > 
                    </PageHeader>
                </Col>
                <Col span={22}>
                    <Table  />
                </Col>
            </Row>

        </Layouts>
    )

}

export default Patient;
